INSERT INTO `formations_realisees` (`id`, `image`, `titre`, `description`, `date_debut`, `date_fin`, `duree`) VALUES
(19, , 'Allemand', '        	Apprenez l’allemand efficacement, pour la vie quotidienne, les loisirs, le travail ou les études ; le Centre de Formation Successway est votre partenaire pleinement qualifié pour les cours d’allemand. Notre offre large vous permet de choisir la formule qui correspond le mieux à vos objectifs. La plupart de nos cours d’allemand sont conçus pour les personnes de niveau débutant ou avancé.\r\n\r\n1) COURS INTENSIFS\r\nApprendre l’allemand de manière intensive et méthodique. Des cours d’allemand toute l’année pour les personnes de niveau débutant ou avancé.\r\n\r\n2) COURS DU SOIR\r\nCOURS DU WEEK-END\r\nUn entraînement linguistique efficace et varié ayant lieu le soir.\r\n\r\n3) COURS DE PRÉPARATION À UN EXAMEN\r\nPréparation ciblée et intensive à un examen.\r\n\r\n4) COURS SPÉCIALISÉS À USAGE PROFESSIONNEL\r\nCours d’allemand pour le quotidien en entreprise dans un contexte interculturel.\r\n', '2021-04-30', '2021-06-13', '30 Heures');
INSERT INTO `formations_realisees` (`id`, `image`, `titre`, `description`, `date_debut`, `date_fin`, `duree`) VALUES
(20, , 'Android', 'Le rôle du développeur Android est de programmer des applications pour smartphones et tablettes Android. À partir d’un cahier des charges ou de l’expression d’un besoin, il doit :\r\n•	concevoir l’architecture technique de l’application,\r\n•	créer son interface et ses éventuelles animations,\r\n•	gérer l’interaction avec l’utilisateur.\r\nIl doit également être en veille active sur ces technologies, et plus particulièrement de l’écosystème Google. Par ailleurs, un développeur Android peut facilement décliner ses applications sur d’autres plateformes comme les montres connectées Android ou l\'Android TV.\r\nEn tant que spécialiste de l’univers Google, le développeur Android doit être force de proposition auprès de ses clients ou de son équipe pour tirer le meilleur des nouveautés matérielles et logicielles.\r\n', '0000-00-00', '0000-00-00', '');
INSERT INTO `formations_realisees` (`id`, `image`, `titre`, `description`, `date_debut`, `date_fin`, `duree`) VALUES
(21, , 'Photoshop', 'Pourquoi choisir une formation Photoshop ?\r\nCette formation à Photoshop va vous permettre d\'apprendre et de maîtriser les meilleures techniques de traitement et de création d\'images. Nos experts en formation maîtrisent parfaitement le logiciel Adobe Photoshop et l\'infographie, et vous proposent une formation dédiée à cet outil. \r\n', '2021-06-02', '2021-07-30', '20 Heures');
INSERT INTO `formations_realisees` (`id`, `image`, `titre`, `description`, `date_debut`, `date_fin`, `duree`) VALUES
(26, , 'Big data et Machine learning', 'Module 1 : Introduction Data Science\r\n\r\nModule 2 : Apprentissage non supervisé\r\n\r\nModule 3 : Apprentissage supervisé  (Classification, Régression)\r\n\r\nModule 4 : Réseaux de neurones artificiels\r\n\r\nModule 5 : Introduction au Deep Learning\r\n\r\nModule 6: Big Data avec Hadoop et MapReduce\r\n\r\nModule 7:  Ecosystème Hadoop avec Hive, Hbase et Flume\r\n\r\nModule 8 : Introduction à apache Spark: Architecture, RDD et Dataframesdatasets\r\n\r\nModule 9 : Machine Learning avec MLlib Spark en utilisant les RDD (pyspark)\r\n\r\nModule 10 : Schéma Spark SQL et Machine Learning avec ML Spark en utilisant les Dataframes\r\n', '0000-00-00', '0000-00-00', '');
INSERT INTO `formations_realisees` (`id`, `image`, `titre`, `description`, `date_debut`, `date_fin`, `duree`) VALUES
(27, , 'Bureautique ', 'formation Informatique Bureautique (100% pratique)\r\n-----------\r\nPROGRAMME DE LA FORMATION :\r\n1) WORD: Initiation/Intermédiaire/Perfectionnement\r\n- Gestion courant (Création d’un nouveau document, Ouvrir, Fermer)\r\n- Traitement de texte en Arabe et Français (Caractères, Paragraphes, Bordures et Trames…)\r\n- Mise en page & Impression\r\n- Conception de tableaux\r\n- Utilisation des Outils de dessin des matières, Index)…\r\n2) EXCEL: Initiation/Intermédiaire/Perfectionnement\r\n- Conception de tableaux\r\n- Saisie et Présentation de données\r\n- Gestion des feuilles de calculs…\r\n3) POWERPOINT: Initiation/Intermédiaire/Perfectionnement\r\n- Gestion des présentations\r\n- Création de diapositives (Gestion de texte, Création de tableau, Graphique, Outils de dessin, Insertion d’images, Photos)…\r\nla formation est certifiée \r\n', '2021-06-03', '2021-06-26', '10 Heures');

